def f_geneTableElements(p_src,s_text,s_key):
    s_element = '<div id="'
    s_element += s_key
    s_element += '" class="tab_i_div"><table><tr><td class="imgTd"><img src="'
    if s_key=="fig23":
        s_element += 'data:image/png;base64,'
    else:
        s_element += p_src
    if s_key == "fig18":
        s_element += '" style="width:1200px;height:210px"/></td><td class="introTd">'
    else:
        s_element += '"/></td><td class="introTd">'
    s_element += s_text
    if s_key=="fig23":
        s_element += ''.join(['Click the follow link to see details: <br><a href="',p_src,'" style="text-decoration:underline;font-weight:bolder;font-size:17px">Click here</a>'])
    s_element += '</td></tr></table></div>'
    return s_element
    
