def f_compHtmlFile(d_23figInfo,s_testFoldName,s_fulltime,s_timeStamp):
    p_html = f_geneAbsPath_frmROOT('files','interpretation.dat')
    s_repHtmlName = ''.join(['intReprt_',s_testFoldName,'_',s_timeStamp,'.html'])
    p_htmlnew = f_geneAbsPath_frmROOT('interpReport',s_repHtmlName)

    # s_time = time.strftime("%Y%m%d %H:%M:%S",time.localtime())
    with open(p_html,'r',encoding='utf-8') as fid_html:
        with open(p_htmlnew,'w',encoding='utf-8') as fid_new:
            s_htmlStr = ''
            for s_line_i in fid_html.readlines():
                s_htmlStr += s_line_i
            #reading done
            fid_new.write(s_htmlStr)
            # write the table elements
            s_23_tables = ''
            for key,val in d_23figInfo.items():
                s_fig_i = f_geneTableElements(val['src'],val['text'],key)
                s_23_tables += s_fig_i
            # print(s_23_tables)
            fid_new.write('\xEF\xBB\xBF')
            fid_new.write(s_23_tables)
            # write the bottom elements
            s_bottom = '</div></div><hr><script>$("#tabs").tabs(),$("#time").html("'
            s_bottom += s_fulltime
            s_bottom += '"),$("#SoftInfo").click(function(){$("#download_d").css("display","none"),$("#email_d").css("display","none"),$("#SoftInfoDown").css("display","block"),setTimeout(function(){$("#SoftInfoDown").css("display","none")},1e4)}),$("#Download").click(function(){$("#SoftInfoDown").css("display","none"),$("#email_d").css("display","none"),$("#download_d").css("display","block"),setTimeout(function(){$("#download_d").css("display","none")},1e4)}),$("#Email").click(function(){$("#download_d").css("display","none"),$("#SoftInfoDown").css("display","none"),$("#email_d").css("display","block"),setTimeout(function(){$("#email_d").css("display","none")},1e4)});		</script><footer><p>The content of this page is licensed under the Apache v2.0.<br>&copy;copyright reserved</p></footer></body></html>'
            fid_new.write(s_bottom)
    #done
    #return value
    return p_htmlnew
    
